Nasdanika SQL provides several modules aiming to help to work with SQL/JDBC data sources. Core Key classes Connector ConnectionFunction Generator Model Loading medatata and saving to XMI Generating a diagram Generating an Ecore model CLI SQL Metadata Catalog diagram Ecore Ecore Doc sql-actions.yml Core This module provides classes for loading data from result sets to EObjects using annotations and generating code. Sources Maven Central Javadoc Key classes Connector Builds SQL statements and other objects for Ecore &lt;-&gt; JDBC interactions using model annotations. In the below code snippet DataType EClass was generated from JDBC metadata with column name annotations for attributes. dataTypeConnector uses these annotations to populate dType objects with data from the dataTypes ResultSet. ResultSet dataTypes = databaseMetaData.getTypeInfo();
Connector&lt;DataType&gt; dataTypeConnector = new Connector&lt;&gt;(SqlPackage.Literals.DATA_TYPE);
while (dataTypes.next()) {
    DataType dType = dataTypeConnector.create(dataTypes);
    dType.setName(dataTypes.getString(&quot;TYPE_NAME&quot;));            
    getDataTypes().add(dType);
}       
 ConnectionFunction A function which takes Connection and ProgressMonitor arguments. It is used by the SQL command (below) to execute logic provided by subcommands. Generator Provides methods for generating Ecore models from metadata. The below code was used to generate the SQL model. String url = &quot;jdbc:h2:mem:testdb;DB_CLOSE_DELAY=-1&quot;;
EPackage ePackage = EcoreFactory.eINSTANCE.createEPackage();
ePackage.setName(&quot;Sql&quot;);
try (Connection conn = DriverManager.getConnection(url, &quot;sa&quot;, &quot;&quot;)) {
    DatabaseMetaData metadata = conn.getMetaData();
    Generator generator = new Generator();
    try (ResultSet resultSet = metadata.getTypeInfo()) {
        EClass eClass = generator.createEClass(resultSet.getMetaData());
        eClass.setName(&quot;DataType&quot;);
        ePackage.getEClassifiers().add(eClass);
    }
    try (ResultSet resultSet = metadata.getTableTypes()) {
        EClass eClass = generator.createEClass(resultSet.getMetaData());
        eClass.setName(&quot;TableType&quot;);
        ePackage.getEClassifiers().add(eClass);
    }           
    try (ResultSet catalogsResultSet = metadata.getCatalogs()) {
        EClass catalogsEClass = generator.createEClass(catalogsResultSet.getMetaData());
        catalogsEClass.setName(&quot;Catalog&quot;);
        ePackage.getEClassifiers().add(catalogsEClass);
    }
    try (ResultSet schemaResultSet = metadata.getSchemas()) {
        EClass schemaEClass = generator.createEClass(schemaResultSet.getMetaData());
        schemaEClass.setName(&quot;Schema&quot;);
        ePackage.getEClassifiers().add(schemaEClass);
    }
    try (ResultSet resultSet = metadata.getTables(null, null, null, null)) {
        EClass eClass = generator.createEClass(resultSet.getMetaData());
        eClass.setName(&quot;Table&quot;);
        ePackage.getEClassifiers().add(eClass);
    }           
    try (ResultSet resultSet = metadata.getColumns(null, null, null, null)) {
        EClass eClass = generator.createEClass(resultSet.getMetaData());
        eClass.setName(&quot;Column&quot;);
        ePackage.getEClassifiers().add(eClass);
    }           
    try (ResultSet resultSet = metadata.getPrimaryKeys(null, null, &quot;MY_TABLE&quot;)) {
        EClass eClass = generator.createEClass(resultSet.getMetaData());
        eClass.setName(&quot;PrimaryKey&quot;);
        ePackage.getEClassifiers().add(eClass);
    }           
    try (ResultSet resultSet = metadata.getImportedKeys(null, null, &quot;MY_TABLE&quot;)) {
        EClass eClass = generator.createEClass(resultSet.getMetaData());
        eClass.setName(&quot;ImportedKey&quot;);
        ePackage.getEClassifiers().add(eClass);
    }           
}       

EEnum typesEnum = EcoreFactory.eINSTANCE.createEEnum();
typesEnum.setName(&quot;Types&quot;);
ePackage.getEClassifiers().add(typesEnum);

Stream.of(java.sql.Types.class.getDeclaredFields())
    .filter(f -&gt; Modifier.isStatic(f.getModifiers()))
    .sorted((a,b) -&gt; a.getName().compareTo(b.getName()))
    .map(f -&gt; {
        EEnumLiteral literal = EcoreFactory.eINSTANCE.createEEnumLiteral();
        literal.setName(f.getName());
        literal.setLiteral(f.getName());
        try {
            literal.setValue(f.getInt(null));
        } catch (IllegalArgumentException | IllegalAccessException e) {
            throw new RuntimeException(e);
        }
        return literal;
    })
    .forEach(typesEnum.getELiterals()::add);

CapabilityLoader capabilityLoader = new CapabilityLoader();
ProgressMonitor progressMonitor = new PrintStreamProgressMonitor();
Requirement&lt;ResourceSetRequirement, ResourceSet&gt; requirement = ServiceCapabilityFactory.createRequirement(ResourceSet.class);       
ResourceSet resourceSet = capabilityLoader.loadOne(requirement, progressMonitor);

Resource resource = resourceSet.createResource(URI.createFileURI(&quot;target/sql.ecore&quot;));
resource.getContents().add(ePackage);
resource.save(null);        
 Model Ecore model of JDBC metatadata. It can be loaded from a DatabaseMetadata object and then be used to generate documentation, Ecore models, code, and diagrams. Sources Maven Central Javadoc Loading medatata and saving to XMI try (Connection conn = ...) {
    Database database = Database.create(conn.getMetaData(), null, null, null, null);

    CapabilityLoader capabilityLoader = new CapabilityLoader();
    ProgressMonitor progressMonitor = new PrintStreamProgressMonitor();
    Requirement&lt;ResourceSetRequirement, ResourceSet&gt; requirement = ServiceCapabilityFactory.createRequirement(ResourceSet.class);       
    ResourceSet resourceSet = capabilityLoader.loadOne(requirement, progressMonitor);

    Resource resource = resourceSet.createResource(URI.createFileURI(&quot;target/metadata.xml&quot;));
    resource.getContents().add(database);
    resource.save(null);                    
}       
 Generating a diagram 
try (Connection conn = ...) {
    Database database = Database.create(conn.getMetaData(), null, null, null, null);

    DiagramGenerator diagramGenerator = new DiagramGenerator();
    for (Catalog catalog: database.getCatalogs()) {
        CatalogGenerationResult cr = diagramGenerator.generateCatalog(catalog, null, null, 1920, 1080);
        Files.writeString(new File(&quot;target/&quot; + catalog.getName() + &quot;.drawio&quot;).toPath(), cr.document().save(null));              
    }            
}       
 Generating an Ecore model try (Connection conn = ...) {
    Database database = Database.create(conn.getMetaData(), null, null, null, null);
    Collection&lt;EObject&gt; sources = new ArrayList&lt;&gt;();
    sources.add(database);
    for (Catalog catalog: database.getCatalogs()) {
        sources.add(catalog);
        for (Schema schema: catalog.getSchemas()) {
            sources.add(schema);
            for (Table table: schema.getTables()) {
                sources.add(table);
                for (ForeignKey ik: table.getImportedKeys()) {
                    sources.add(ik);
                }
                for (Column col: table.getColumns()) {
                    sources.add(col);
                }                       
            }
        }
    }

    EcoreGenerator ecoreGenerator = new EcoreGenerator();
    Transformer&lt;EObject,EModelElement&gt; transformer = new Transformer&lt;&gt;(ecoreGenerator);
    ProgressMonitor progressMonitor = new PrintStreamProgressMonitor();
    Map&lt;EObject, EModelElement&gt; result = transformer.transform(sources, false, progressMonitor);

    CapabilityLoader capabilityLoader = new CapabilityLoader();
    Requirement&lt;ResourceSetRequirement, ResourceSet&gt; requirement = ServiceCapabilityFactory.createRequirement(ResourceSet.class);       
    ResourceSet resourceSet = capabilityLoader.loadOne(requirement, progressMonitor);

    Resource resource = resourceSet.createResource(URI.createFileURI(&quot;target/metadata.ecore&quot;));
    resource.getContents().add(result.get(database));
    resource.save(null);        
}       
 CLI This module provides several commands which can be organized in chains to perform database operations from the command line. Sources Maven Central Javadoc SQL sql establishes a database connection and is used by subcommands to execute connection functions with built-in telemetry. Metadata metadata command loads database metadata into a model and makes it available to subcommands. Catalog diagram catalog-diagram generates a Draw.io diagram for a database catalog with a diagram page per schema. There is an option to add documentation properties to diagram elements and then generate a documentation site from the diagram. Ecore ecore generates an Ecore model from database metadata. The model can then be used to generate Java model classes and use them to load data from the database using the Connector class without having to write SQL. The generated model can be modified by removing attributes which are not needed, introducing type hierarchy based on some database information. For example, Man/Woman classes extending Person class and loaded from PEOPLE table. Or a Manager class extending Employee class - Manager class would have reports reference and would only be created if there are people reporting to a given employee. Ecore This module provides several processor classes for generating this Ecore model documentation. Sources Maven Central Javadoc Doc This module provides several processor classes for generating HTML documentation from the metadata models. Sources Maven Central Javadoc Demo The below snippet demonstrates how to generate database metamodel documentation. CapabilityLoader capabilityLoader = new CapabilityLoader();
ProgressMonitor progressMonitor = new PrintStreamProgressMonitor();

Requirement&lt;ResourceSetRequirement, ResourceSet&gt; requirement = ServiceCapabilityFactory.createRequirement(ResourceSet.class);       
ResourceSet resourceSet = capabilityLoader.loadOne(requirement, progressMonitor);
Resource resource = resourceSet.getResource(URI.createFileURI(&quot;test-metadata.xml&quot;), true);
Database database = (Database) resource.getContents().get(0);
MutableContext context = Context.EMPTY_CONTEXT.fork();

Consumer&lt;Diagnostic&gt; diagnosticConsumer = d -&gt; d.dump(System.out, 0);       
EcoreHtmlAppGenerator htmlAppGenerator = EcoreHtmlAppGenerator.loadEcoreHtmlAppGenerator(
        Collections.singleton(database), 
        context,
        null, // java.util.function.BiFunction&lt;URI, ProgressMonitor, Action&gt; prototypeProvider,         
        null, // Predicate&lt;Object&gt; factoryPredicate,
        null, // Predicate&lt;EPackage&gt; ePackagePredicate,
        diagnosticConsumer,
        progressMonitor);

File actionModelsDir = new File(&quot;target\\action-models\\&quot;);
actionModelsDir.mkdirs();
File output = new File(actionModelsDir, &quot;sql-actions.xmi&quot;);
htmlAppGenerator.generateHtmlAppModel(
        diagnosticConsumer, 
        output,
        progressMonitor);

// Generating a web site
String rootActionResource = &quot;sql-actions.yml&quot;;
URI rootActionURI = URI.createFileURI(new File(rootActionResource).getAbsolutePath());//.appendFragment(&quot;/&quot;);

AppSiteGenerator actionSiteGenerator = new AppSiteGenerator() {

    @Override
    protected Context createContext(ProgressMonitor progressMonitor) {
        return context;
    }

};      

String siteMapDomain = &quot;https://something.org&quot;;     
Map&lt;String, Collection&lt;String&gt;&gt; errors = actionSiteGenerator.generate(
        rootActionURI, 
        Theme.Cerulean.pageTemplateCdnURI, 
        siteMapDomain, 
        new File(&quot;target/sample-database-docs&quot;),  
        new File(&quot;target/sample-database-doc-site-work-dir&quot;), 
        true);

int errorCount = 0;
for (Entry&lt;String, Collection&lt;String&gt;&gt; ee: errors.entrySet()) {
    System.err.println(ee.getKey());
    for (String error: ee.getValue()) {
        System.err.println(&quot;\t&quot; + error);
        ++errorCount;
    }
}

System.out.println(&quot;There are &quot; + errorCount + &quot; site errors&quot;);
