          location: https://github.com/Nasdanika-Models/sql Database Database is the top-level object containing catalogs, data types and table types Catalog A catalog is typically the top-level container for database objects like schemas, tables, and views Schema A database schema is the blueprint or architecture of a database. It defines how data is organized, structured, and related within the system Data Type A database data type defines the kind of data that can be stored in a particular column of a database table Table A database table is the core structure used to store data in a relational database. Think of it as a grid or spreadsheet where each row represents a record and each column represents a field or attribute of that record. Column A database column is one of the fundamental building blocks of a relational database table Foreign Key An imported key in a relational database refers to a foreign key that a table receives from another table Primary Key A primary key is a fundamental concept in relational databases &mdash; it uniquely identifies each record (row) in a table Table type Table type refers to the classification of a table-like object. It helps distinguish бetween different kinds of structures that behave like tables but serve different purposes. SQL
